import { useSelector } from "react-redux";

const TodoList = () => {
  const todos = useSelector((state) => state.todo.todolist);
  console.log(todos);
  return (
    <div>
      {todos.map((todo) => {
        <TodoItem todo />;
      })}
    </div>
  );
};

export default TodoList;
